/*Table structure for table `mb_user_detail` */

DROP TABLE IF EXISTS `mb_user_detail`;

CREATE TABLE `mb_user_detail` (
  `user_id` int(11) NOT NULL,
  `name` varchar(50) DEFAULT NULL COMMENT '真实姓名或昵称',
  `real_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `mood_id` int(3) DEFAULT NULL COMMENT '表情ID',
  `sex` tinyint(1) DEFAULT '1' COMMENT '性别，0：未知 1：男 2：女',
  `area` varchar(50) DEFAULT NULL COMMENT '所在地',
  `telephone` varchar(30) DEFAULT NULL COMMENT '固定电话',
  `company` varchar(200) DEFAULT NULL COMMENT '单位名称',
  `industry` tinyint(2) DEFAULT NULL COMMENT '所属行业',
  `address` varchar(200) DEFAULT NULL COMMENT '单位地址',
  `blog` varchar(50) NOT NULL COMMENT '博客地址',
  `qq` varchar(50) NOT NULL COMMENT 'QQ号码',
  `msn` varchar(50) NOT NULL COMMENT 'MSN地址',
  `birthday` date NOT NULL COMMENT '生日',
  `card_type` varchar(32) NOT NULL COMMENT '证件类型',
  `card_contents` varchar(32) NOT NULL COMMENT '证件号码',
  `description` varchar(255) DEFAULT NULL COMMENT '用户简介',
  `create_time` int(10) DEFAULT NULL COMMENT '创建时间',
  `update_time` int(10) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户详细表';

